import React from 'react';
import styled from 'styled-components';

const Element = styled.div`
    display: flex;

    & > * {
        flex: 1;
    }
`;

const Split = (props) => {
    return (
        <Element>
            {props.children}
        </Element>
    );
}

export default Split;
